const Body = () => {
  return (
    <main className="body">
      <h2>Welcome to My Website</h2>
      <p>This is a sample website with some dummy content to demonstrate how to structure a React application with a Header, Body, and Footer component.</p>
      <p>Feel free to explore and customize it further!</p>
    </main>
  );
};

export default Body;
